INSERT INTO `contacto` (`ID_Contacto`, `Nombre`, `Correo`, `Asunto`, `Mensaje`, `Contestado`, `Fecha`) VALUES
(1, 'ALMA LORENA MORALES MARTINEZ', 'almamm2002@hotmail.com', 'INFORMACION COMPLETA', 'Nuenas tardes por favor enviar la informacion completa a mi correo gracias ', 0, '0000-00-00 00:00:00'),
(2, 'Juan Carlos Jardon lara', 'jjardon@confianzasolidaria.com', 'Informacion', 'Buenas tardes \r\npodrÃ­an darme el telÃ©fono de sus oficinas ', 1, '0000-00-00 00:00:00'),
(3, 'Susana LÃ³pez Alvarado', 'susylo666@yahoo.com.mx', 'informaciÃ³n', '\r\nTengo varias preguntas:\r\n-Â¿El contrato se hace por un aÃ±o o por cuanto tiempo?\r\n-Â¿QuiÃ©n me garantiza que mi dinero esta seguro?\r\n-Â¿QuÃ© pasarÃ­a si hay una caÃ­da del producto?\r\n-Â¿El rendimiento cada cuando se dispone de Ã©l?', 1, '0000-00-00 00:00:00'),
(4, 'Luis RamÃ³n', 'luis.ramon96@hotmail.com', 'InformaciÃ³n ', 'Buenos dÃ­as, podrÃ­a enviarme informaciÃ³n con todos los detalles del cÃ³mo es la inversiÃ³n con ustedes por favor. me interesa saber el monto mÃ­nimo y mÃ¡ximo a invertir y cÃ³mo es que se obtiene el rendimiento.', 1, '0000-00-00 00:00:00'),
(5, 'Jaime Navarro', 'jainava3515@gmail.com', 'Dudas ', 'CÃ³mo garantizas mi inversiÃ³n?', 1, '0000-00-00 00:00:00'),
(6, 'jorge', 'jorge.canchola@mx.abb.com', 'Duda de saber si puedo cosechar antes de los 6 aÃ±os', 'Buenas tardes, me duda es con referencia a si, yo invierto $100,000 pesos para 1000 plantas, y si yo quiesiera vender mis mil plantas antes de los 6 aÃ±os, se puede hacer eso, in ejemplo , a lo 4 o 5 aÃ±os?\r\nY la otra pregunta es como esta protegida mi inversion, existe algun riesgo que pierda mis $100,000 pesos?', 1, '0000-00-00 00:00:00'),
(7, 'AngÃ©lica HernÃ¡ndez  Mireles ', 'angeleoval@gmail.com', 'Dudas', 'Hola buen  dÃ­a.\r\n Â¿Quiero saver mas a profundidad de su information?\r\nÂ¿Es una inversion  fintec?\r\n\r\nÂ¿Tienen papeles de certificaciÃ³n?  \r\n Con la comicion nacional bancaria y de valores ?\r\n\r\nÂ¿PUESDES COMPRAR UNA PLANTA QUE YA TENGAPOR EJEMPLO 3 AÃ‘OS Y DESPUEDES COMPRAR UNA MAS PEQUEÃ‘AS?   O\r\n\r\nÂ¿NECESITO VENDER MI PLANTA MAS GRANDE PARAINVERTIR DE NUEVO MI DINERO  EN PLANTAS MAS PEQUEÃ‘AS?\r\n\r\n\r\nÂ¿CÃ³mo funciona la inverciÃ³n  a partir de que lapso de tiempo puedes empezar a disponer de tus ganancias?\r\n\r\n\r\nÂ¿para comprar a 90 pesos plants la inversion tiene que ser de cuanto el monto?\r\n', 0, '0000-00-00 00:00:00'),
(11, 'David morales', 'arquidavid@hotmail.com', 'Me interesa invertir', 'Hola buen dÃ­a, estoy interesado en invertir en JIMA pero aÃºn tengo varias dudas  y me gustarÃ­a me ayudaran a resolverlas por favor.\r\nYo ahora estoy viviendo en USA y no puedo ir a MÃ©xico, como puedo invertir sin estar alla.\r\n\r\nHe visto en varias publicaciones que puedo invertir desde 10 000 pesos, pero puedo realizar varias inversiones en 1 aÃ±o o solo 1 cada 6 aÃ±os.\r\n\r\nGracias.', 0, '2020-02-22 09:45:25'),
(12, 'MANUEL ALEJANDRO CALDERA DE LA ROSA', 'alejandrocaldera@outlook.com', 'SOLICITUD DE INFORMACION', 'podria enviarme informacion?', 1, '2020-02-27 17:36:23'),
(13, 'Elsa Alvarez', 'ddj71@hotmail.com', 'Informacion', 'Me gustarÃ­a saber mas sobre cÃ³mo se maneja la inversiÃ³n si por ejemplo mi inversiÃ³n fuera de 10000. Las plantas que se adquieren son a 6 aÃ±os o como. Y si fuedws ir incrementando tu invercion', 0, '2020-03-07 22:26:49'),
(14, 'Ruby', 'rubyna151512@gmail.com', 'Solicito informaciÃ³n mÃ¡s precisa', 'Me interesa pero aÃºn no me queda claro cÃ³mo serÃ¡ mi cosecha \r\nMe podrÃ­as mandar informaciÃ³n de todo, \r\ndesde la plantaciÃ³n hasta la jima\r\n', 1, '2020-03-10 23:02:15'),
(15, 'Ana Martinez', 'anamartinezdemurry@gmail.com', 'Invertir', 'Me gustaria saber mas aserca de invertir ', 0, '2020-03-15 22:50:27'),
(16, 'Ana Martinez ', 'anamartinezdemurry@gmail.com', 'Invertir', 'Quiero saber como invertir ', 1, '2020-03-15 22:52:45'),
(17, 'Jose Lopez', 'J-lopez-1989@hotmail.com', 'Inversion', 'Hola buenas tardes solo queria saber informacion sobre inversion y mas informacion de ustedes gracias.', 1, '2020-03-18 16:56:45'),
(18, 'EMMANUEL LOPEZ', 'manylopezcuci@gmail.com', 'solicitaciÃ³n de informaciÃ³n', 'Hola buenas tardes, me interesarÃ­a conocer mas sobre todos los requisitos de inversiÃ³n.\r\n', 1, '2020-03-18 18:24:12'),
(19, 'Isaac RodrÃ­guez', 'isaacrodrihdz@hotmail.com', 'Me interesarÃ­a invertir ', 'Buen dÃ­a, la propuesta me parece interesante y quisiera mÃ¡s informaciÃ³n acerca de la idea en general\r\nGracias', 1, '2020-03-19 15:38:20'),
(20, 'JosÃ© MarÃ­a', 'chema30.miranda@gmail.com', 'Duda', 'Hola que tal, me parece muy interesante este proyecto de jima y me gustarÃ­a saber mÃ¡s de Ã©l para invertir\r\nMi principal duda es que tan segura es la inversiÃ³n o si existen riesgos de perder la inversiÃ³n asÃ­ como en cuanto tiempo podrÃ© estar retirando dinero\r\n\r\nDe antemano muchas gracias por la informaciÃ³n', 1, '2020-03-22 15:50:10'),
(21, 'Roberto madar', 'medicenmadar@gmail.com', 'InversiÃ³n', 'Hola, me pueden proporcionar los diferentes planes de inversiÃ³n y si manejan distribuidores en Monterrey .?', 1, '2020-03-23 00:23:24'),
(22, 'Anselmo MartÃ­nez', 'amartinezpv@gmail.com', 'Dudas ', 'Buenas tardes, me interesa invertir pero antes me gustarÃ­a saber cÃ³mo funciona exactamente, \r\n3316199821', 1, '2020-03-24 14:56:57'),
(23, 'adalberto hernandez', 'hernandez_adalberto@yahoo.com', 'como funciona', 'Quisiera saber mas informacion porque yo estoy en los angeles tambiÃ©n quisiera saber si las plantas son plantadas en arandas.', 1, '2020-03-25 16:27:10'),
(24, 'Huetzin Barba', 'huetzinbarba@gmail.com', 'Contacto', 'Hola, intento contactarlos, el cel estÃ¡ fuera de linea, contÃ¡ctenme cuando tengan oportunidad, 3781008630', 1, '2020-03-27 15:40:14'),
